import './CSS/Footer.css';


export default function Footer(){
    return(
        <footer className="footer">
            
        </footer>
    );
}


function Btn(params){
    return(
        <Link to={params.link} className="navbar-btn-shell">
            <button className="navbar-btn btn-clickable">{params.title}</button>
        </Link>
    );
}
